#include <stdio.h>
#include <string.h>
#include <assert.h>
char *input[] = {
"",
"",
"",
"",
"",
};

void process(char *str)
{
	char *shit[] = {
		"xxxxxxx",
		"xxx1xxx",
		"xx234xx",
		"x56789x",
		"xxABCxx",
		"xxxDxxx",
		"xxxxxxx",
	};
	int xpos = 1, ypos = 3;
	int newxpos, newypos;

	for (int i = 0; i < strlen(str); i++) {
		newxpos = xpos;
		newypos = ypos;
		if (str[i] == 'D') {
			newypos++;
		} else if (str[i] == 'L') {
			newxpos--;
		} else if (str[i] == 'U') {
			newypos--;
		} else if (str[i] == 'R') {
			newxpos++;
		} else {
			assert(0);
		}
		if (shit[newxpos][newypos] != 'x') {
			xpos = newxpos;
			ypos = newypos;
		}
	}
	printf("%c", shit[ypos][xpos]);
}

int main()
{

	for (int i = 0; i < 5; i++) process(input[i]);
	printf("\n");
	return 0;
}
